import React, { Component } from 'react';
import './App.css';
import Parks from './Park/Park';
import data from './np_from_WIKI.json'

class App extends Component {
  render() {
    state = {
      parks:[]
    }

    const {parks} = this.state;
    return (
      <div className="App">
        <div className="wrapper">{data["table"].map((e, i) => {return <Parks name={e.name} url={"http://" + e.image} />})}
          </div>
      </div>
    );
  }
}

export default App;
